import { motion, useAnimation, AnimatePresence } from 'framer-motion';
import { useState, useEffect } from 'react';

export const Example = () => {
  const [activeDemo, setActiveDemo] = useState(null);
  const [score, setScore] = useState(0);
  const [gameStarted, setGameStarted] = useState(false);
  const [targets, setTargets] = useState([]);
  const controls = useAnimation();

  const generateTargets = () => {
    return [...Array(3)].map((_, i) => ({
      id: i,
      x: Math.random() * 280,
      y: Math.random() * 160,
      collected: false
    }));
  };

  const startGame = () => {
    setScore(0);
    setTargets(generateTargets());
    setGameStarted(true);
  };

  const demos = [
    {
      title: "Collect The Stars ⭐",
      color: "bg-gradient-to-r from-purple-500 to-pink-500",
      content: (
        <div className="relative h-[300px] bg-black/10 rounded-lg p-4">
          {!gameStarted ? (
            <motion.button
              className="absolute top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2 
                         px-6 py-3 bg-white/20 rounded-lg text-white font-bold"
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.95 }}
              onClick={startGame}
            >
              Start Game
            </motion.button>
          ) : (
            <>
              <motion.div
                className="w-16 h-16 bg-white/20 rounded-lg absolute cursor-grab flex items-center justify-center"
                drag
                dragConstraints={{
                  top: 0,
                  left: 0,
                  right: 280,
                  bottom: 160
                }}
                whileDrag={{ scale: 1.2 }}
                onDragEnd={(event, info) => {
                  targets.forEach((target, index) => {
                    if (!target.collected &&
                        Math.abs(info.point.x - target.x - 100) < 50 &&
                        Math.abs(info.point.y - target.y - 100) < 50) {
                      const newTargets = [...targets];
                      newTargets[index].collected = true;
                      setTargets(newTargets);
                      setScore(score + 1);
                    }
                  });
                }}
              >
                🚀
              </motion.div>
              {targets.map((target, i) => (
                !target.collected && (
                  <motion.div
                    key={i}
                    className="absolute w-8 h-8 flex items-center justify-center"
                    style={{ left: target.x, top: target.y }}
                    animate={{
                      scale: [1, 1.2, 1],
                      rotate: [0, 180, 360],
                    }}
                    transition={{
                      duration: 2,
                      repeat: Infinity,
                    }}
                  >
                    ⭐
                  </motion.div>
                )
              ))}
              <div className="absolute top-4 right-4 text-white font-bold">
                Score: {score}
              </div>
            </>
          )}
        </div>
      )
    },
    {
      title: "Chain Reaction 🔄",
      color: "bg-gradient-to-r from-blue-500 to-teal-500",
      content: (
        <div className="grid grid-cols-4 gap-2">
          {[...Array(16)].map((_, i) => (
            <motion.div
              key={i}
              className="aspect-square bg-white/20 rounded-lg"
              whileHover={{ scale: 1.2 }}
              onHoverStart={() => {
                controls.start(i.toString(), {
                  scale: [1, 1.5, 1],
                  rotate: 360,
                  transition: { duration: 0.5 }
                });
                // Trigger neighbors
                const neighbors = [i-4, i+4, i-1, i+1].filter(n => n >= 0 && n < 16);
                neighbors.forEach(n => {
                  controls.start(n.toString(), {
                    scale: [1, 1.2, 1],
                    transition: { duration: 0.3, delay: 0.1 }
                  });
                });
              }}
              animate={controls}
              custom={i}
            />
          ))}
        </div>
      )
    },
    {
      title: "Music Visualizer 🎵",
      color: "bg-gradient-to-r from-orange-500 to-red-500",
      content: (
        <div className="flex items-end justify-center h-48 gap-1">
          {[...Array(20)].map((_, i) => (
            <motion.div
              key={i}
              className="w-4 bg-white/20 rounded-t-lg"
              animate={{
                height: [20, 100, 20],
              }}
              transition={{
                duration: 1 + Math.random(),
                repeat: Infinity,
                repeatType: "reverse",
                delay: i * 0.05,
              }}
              whileHover={{
                backgroundColor: "rgba(255,255,255,0.4)",
                scale: 1.2
              }}
            />
          ))}
        </div>
      )
    },
    {
      title: "Particle Tunnel 🌀",
      color: "bg-gradient-to-r from-green-500 to-yellow-500",
      content: (
        <div className="relative h-48">
          {[...Array(20)].map((_, i) => (
            <motion.div
              key={i}
              className="absolute left-1/2 top-1/2 w-2 h-2 bg-white/40 rounded-full"
              animate={{
                scale: [0, 3, 0],
                opacity: [0, 1, 0],
                rotate: [0, 360],
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
                delay: i * 0.1,
                ease: "linear"
              }}
              style={{
                rotate: `${i * 18}deg`,
              }}
            />
          ))}
        </div>
      )
    }
  ];

  return (
    <div className="flex flex-col items-center justify-center min-h-[600px] p-8">
      <div className="grid grid-cols-2 gap-4 mb-8 w-full max-w-2xl">
        {demos.map((demo, index) => (
          <motion.button
            key={index}
            className={`${demo.color} p-6 rounded-xl text-white font-bold text-lg`}
            whileHover={{ scale: 1.02 }}
            whileTap={{ scale: 0.98 }}
            onClick={() => setActiveDemo(activeDemo === index ? null : index)}
          >
            {demo.title}
          </motion.button>
        ))}
      </div>

      <AnimatePresence mode="wait">
        {activeDemo !== null && (
          <motion.div
            key={activeDemo}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            className={`${demos[activeDemo].color} p-8 rounded-xl w-full max-w-2xl`}
          >
            {demos[activeDemo].content}
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};
